import React from 'react';
import Grid from '@material-ui/core/Grid';
import { FILTER_LABELS } from 'shared/constants/stringConstantsSelectors';
import { PRODUCT_TYPE } from 'shared/constants/domainConstantSelectors';
import { SingleSelect } from 'components/common/input/selects/singleSelect';

export const CommonFilterCollection = props => {

    const productTypeMenuItems = GET_PRODUCT_TYPE(props.demoMode);

    return (
        <Grid container spacing={1}>
            <SingleSelect 
                handleFilterChange={props.handleProductType} 
                inputLabel={FILTER_LABELS.PRODUCT_TYPE}
                menuItems={productTypeMenuItems}
            />
            {props.filterGroup}
        </Grid>

    );
};
